stateMachine.definition:
{
  "Comment": "Calling APIGW HTTP Endpoint",
  "StartAt": "Call API",
  "States": {
    "Call API": {
      "Type": "Task",
      "Resource": "arn:aws:states:::apigateway:invoke",
      "Parameters": {
        "ApiEndpoint": "i4dl6so1m4.execute-api.eu-north-1.amazonaws.com",
        "Method": "GET",
        "AuthType": "IAM_ROLE"
      },
      "Next": "Call Successful?"
    },
    "Call Successful?": {
      "Type": "Choice",
      "Choices": [
      {
        "Variable": "$.StatusCode",
        "NumericEquals": 200,
        "Next": "Notify Success"
      }
      ],
      "Default": "Notify Failure"
    },
    "Notify Success": {
      "Type": "Task",
      "Resource": "arn:aws:states:::sns:publish",
      "Parameters": {
        "Message": "Call was successful",
        "TopicArn": "arn:aws:sns:eu-north-1:837614956853:StepFunctionsSample-ApiGatewayECSWorkflow7ce36efd-85fd-4bbf-996d-4739394205ad-SNSTopic-RhLKkcsL7Iix"
      },
      "End": true
    },
    "Notify Failure": {
      "Type": "Task",
      "Resource": "arn:aws:states:::sns:publish",
      "Parameters": {
        "Message": "Call was not successful",
        "TopicArn": "arn:aws:sns:eu-north-1:837614956853:StepFunctionsSample-ApiGatewayECSWorkflow7ce36efd-85fd-4bbf-996d-4739394205ad-SNSTopic-RhLKkcsL7Iix"
      },
      "End": true
    }
  }
}
